import AppRoutes from "routes/AppRoutes";
import { BrowserRouter as Router } from "react-router-dom";
import { CarProvider } from "./context/CarContext";

export default function App() {
  return (
    <CarProvider>
      <Router>
        <AppRoutes />
      </Router>
    </CarProvider>
  );
}
